import './App.css';

function App() {
  const users=[
    {name: "sajith", age:25},
    {name: "john", age: 24},
    {name: "lucas", age: 22},
  ];
  return(
    <div className="App">
      {users.map((user,key) =>{
        return <User name={user.name} age={user.age} />;

  })}
 </div>
  );
} 

const User=(props) => {
  return(
    <div>
      {props.name} {props.age}
    </div>
  );
};



export default App;
